 - "ΪΫϏ":                                       	#  0x3aa, 0x3ab, 0x3cf
    - test: 
        if: "$CapitalLetters_Beep"
        then:
        - audio:
            value: "beep.mp4"
            replace: []
    - test: 
        if: "$CapitalLetters_UseWord"
        then_test:
          if: "$SpeechOverrides_CapitalLetters = ''"
          then_test:
            if: "$Impairment = 'Blindness'"
            then: [T: "iso"]         	# 	(en: 'cap', google translation)
          else: [x: "$SpeechOverrides_CapitalLetters"] 
    - pitch:
        value: "$CapitalLetters_Pitch"
        replace: [SPELL: "translate('.', 'ΪΫϏ', 'ιυϗ')"]
    - T: "dialyytikalla"                        	# 	(en: 'with dialytika', google translation)
 - "ϊ": [T: "treema-ioota"]           	            #  0x3ca	(en: 'iota with dialytika', google translation)
